import React from 'react';

function getStatusClass(comparison) {
  switch (comparison) {
    case "=":
      return "correct";
    case "<":
      return "incorrect-less";
    case ">":
      return "incorrect-greater";
    default:
      return "";
  }
}

export default function CityDetails({ kraj, populace, rozloha, similarites }) {
  if (!similarites) {
    console.log("Waiting for data..."); // Kontrolní výpis
    return <div>Loading...</div>;
  }

  console.log("Displaying city details:", { kraj, populace, rozloha, similarites }); // Kontrolní výpis

  return (
    <div className="container text-center mb-2">
      <div className="row">
        {/* Další JSX pro zobrazení detailů města */}
      </div>
    </div>
  );
}
